function App() {

	const welcomeTitle={
		transform:'translate(-50%,-50%)',
		top:'50%',
		left:'50%',
		position:'absolute',
	}
	const onlinequiz={
		fontWeight:'bolder'
	}

	return(
		<div className='bg-danger' id='bgImage'>
			<div className='d-fle' style={welcomeTitle}>
				<h1 className='display-3' style={onlinequiz}>Online Quizz</h1>
				<h6>Quick Quiz knowledge Booster for a Perfect Level Up</h6>
				<hr className='text-dark'></hr>
				<h2 className='display-5'>Welcome!</h2>
			</div>
		</div>
	);
}

export default App;
